INSERT INTO `surveys` VALUES (1,1,1,'Alexander Bachschmid','Testumfrage','Testbeschreibung kurz','Testbeschreibung lang',NULL,NULL,'2020-05-26 00:00:00','2020-05-28 00:00:00',0,0,1,0,0,'2020-05-18 07:39:27','2022-12-07 09:52:59',NULL),(2,1,1,'Corporate Happiness GmbH','Mitarbeiterbefragung „Elvermann GmbH“','Mitarbeiterbefragung der „Elvermann GmbH“','<div><b>Liebe Mitarbeiterin, lieber Mitarbeiter,</b></div><div><br></div><div>wir freuen uns, dass Du Dich an der Mitarbeiterbefragung beteiligst. Gefragt ist dabei Deine ganz persönliche und ehrliche Meinung zu verschiedenen Themen, die wir in den folgenden Fragen zusammengefasst haben. Alle Angaben sind absolut anonym und können nicht personalisiert werden. Die Zugangsdaten wurden zufällig aus einer Lostrommel gezogen und die darauf enthaltenen Daten dienen ausschließlich dem Login.</div><div>Mit Deiner Teilnahme hilfst Du uns, einen aktuellen Ist-Zustand zur Mitarbeiterzufriedenheit in unserem Unternehmen festzustellen.</div><div><br></div><div><b>Noch ein paar allgemeine Hinweise:</b></div><div>- Die Teilnahme an der Befragung ist freiwillig.</div><div>- Die Befragung erfolgt anonym. Es erfolgt lediglich eine Zuordnung zum Bereich \"gewerblich\" oder \"kaufmännisch\", um eine detaillierte Analyse der Ergebnisse anfertigen zu können.</div><div>- Die Daten können nicht personalisiert werden.</div><div>- Das Gesamtergebnis wird allen MitarbeiterInnen zugänglich gemacht.</div><div>- Die vollständige Bearbeitung dauert ca. 20 bis 30 Minuten.</div><div>- Bitte denke auf der letzten Seite unbedingt daran auf den Button \"Umfrage abschließen\" zu klicken!<br></div><div><br></div><div>Bitte wähle auf den folgenden Seiten jeweils eine Antwort unter den fünf Auswahlmöglichkeiten aus (Schieberegler nach links oder rechts verschieben oder in der Mitte anklicken) und drücke dann auf \"Antwort speichern\". Darüber hinaus gibt es auch einige offene Fragen, bei denen Du Deine Antwort als Freitext in das Kommentarfeld eintragen kannst. Bitte nimm Dir für die Beantwortung dieser offenen Fragen gewissenhaft Zeit, denn die statistischen Werte sind das Eine. Wir interessieren uns aber vor allem auch für das, was Dir darüber hinaus wichtig ist uns mitzuteilen!</div><div><br></div><div>Viel Spaß beim Ausfüllen und schonmal ganz herzlichen Dank für Deine Teilnahme!</div><div><br></div><div>Herzliche Grüße,</div><div><br></div><div><i>Jürgen Elvermann und Klaus Elvermann sowie das Team der Corporate Happiness GmbH</i></div>','Herzlichen Dank für deine Antworten. Bitte denke daran, unten auf <b>Umfrage abschließen</b>&nbsp;zu klicken.','Herzlichen Dank für Deine Teilnahme an der Befragung! Das bedeutet uns wirklich viel!','2020-12-09 06:00:00','2022-12-07 10:52:59',0,0,1,0,1,'2020-12-02 19:53:42','2022-12-07 09:52:59',NULL),(3,1,0,'Corporate Happiness GmbH','Mitarbeiterbefragung „Elvermann GmbH“','Mitarbeiterbefragung der „Elvermann GmbH“','Die Mitarbeiterbefragung der <b>„Elvermann GmbH</b>“.','Vielen Dank für Ihre Teilnahme an der anonymen Umfrage','Vielen Dank für Ihre Teilnahme an der anonymen Umfrage','2020-12-03 09:00:00','2020-12-25 18:15:00',0,0,1,0,1,'2020-12-03 10:22:17','2022-12-07 09:52:59','2020-12-03 11:31:53'),(4,1,1,'Alexander Bachschmid','Fantasy-Umfrage für die Statistiken ;)','Diese Umfrage dient lediglich der Auswertung','Bitte beantworten Sie diese Umfrage gemäß Ihrer Eigenschaften und ehrlichen Einschätzung','Nach Abschluss der Umfrage sind Ihre eingegebenen Daten nicht wieder zu korrigieren.','Vielen lieben Dank für Ihre Teilnahme an dieser Umfrage! Ihre Daten werden vertraulich behandelt!','2022-01-06 15:15:00','2022-01-07 18:30:00',0,0,1,0,1,'2022-01-06 16:48:23','2022-01-08 15:12:22',NULL),(5,1,0,NULL,'Trash-Umfrage',NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,0,0,'2022-01-07 12:44:24','2022-01-07 12:44:24',NULL);
